import React from 'react'
import "../../App.css";
import "./Alps.css";

function Alps() {
    return (
        <>
            <div className='contain'>
                <div className='alps-title'>
                    ALPS MOUNTAINS
                </div>
                <br />
                <div className='paragraph'>
                    <p>
                        &emsp;&emsp;&emsp;&emsp;&emsp;&emsp;The Alps are the highest and most extensive mountain range system that lies entirely in Europe, stretching approximately 750 mi (1,210 km) across eight Alpine countries (from west to east): France, Switzerland, Monaco, Italy, Liechtenstein, Austria, Germany, and Slovenia.<br />
                        
                    </p>
                </div>
            </div>
        </>
    );
}

export default Alps
